import React from "react";
import "./Search.css";

const Search = () => {
  return (
    <div>
      <form className="search">
        <input type="text" placeholder="Type a city ..." />
        <button type="submit">Search</button>
        <button>
          <FontAwesomeIcon icon="fa-thin fa-location-dot" />
        </button>
      </form>
    </div>
  );
};

export default Search;
